If you’re a woman 40 and older, and you’re looking to learn more about perimenopause & menopause, we've got you covered!⁣
⁣
Join us for a day of community, education, and fun on October 21st, 2023, for a deep dive into perimenopause and menopause. You'll learn from 13+ menopause experts who will share their insights and expertise, including solutions, for this phase of life.⁣
⁣
The event will dispel myths, provide answers, and help you reclaim your power. This day includes a yummy lunch, a swag bag of goodies, and shopping from hand-selected vendors.⁣
⁣
I'm the host for the day, and I can't wait to meet you in person! ~ Andrea Donsky, nutritionist, Menopause Educator, and researcher⁣
⁣
Every attendee gets lunch and a goodie bag worth over $250!⁣
